window.bookSummaryJSON = "<p>Lola Winters doesn’t think she can escape her life as a waitress - until she receives a shocking proposition from a handsome stranger.&nbsp;</p> <p>Wealthy businessman Beau Olivier is willing to do anything to have Lola for a night. His conditions are explicit: from sunset to sunrise, Lola must submit all of herself to him - body, mind, and soul. But what if Beau doesn’t want to say goodbye in the morning?&nbsp;</p> <p><i>A red-hot collection that includes four full-length audiobooks: </i>Possession<i>,</i> Domination<i>,</i> Provocation<i>, and </i>Obsession<i>. </i>Possession <i>was a 2019 Audie Award finalist and AudioFile Earphones Award Winner.</i></p>"; 
